-- ----------------------------
-- Procedure structure for `getChildList`
-- ----------------------------
DROP PROCEDURE IF EXISTS `getChildList`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `getChildList`(rootId INT, inTableName VARCHAR(32))
BEGIN 
	DECLARE sTemp VARCHAR(1000); 
	DECLARE sTempChd VARCHAR(1000); 
	
	SET @sTemp = '$'; 
	SET @sTempChd =cast(rootId as CHAR); 
	 
	WHILE sTempChd is not null DO 
			SET @sTemp = concat(@sTemp,',',@sTempChd); 
			SET @SqlCmd  = CONCAT( 'SELECT group_concat(id) INTO sTempChd FROM ' , inTableName,  ' where FIND_IN_SET(pid,sTempChd)>0' ); 
			EXECUTE stmt USING @SqlCmd ;
	END WHILE; 
	select sTemp; 
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `getDeviceTree`
-- ----------------------------
DROP FUNCTION IF EXISTS `getDeviceTree`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getDeviceTree`(rootId INT) RETURNS varchar(1000) CHARSET utf8
BEGIN 
	DECLARE sTemp VARCHAR(1000); 
	DECLARE sTempChd VARCHAR(1000); 
	
	SET sTemp = '0'; 
	SET sTempChd =cast(rootId as CHAR); 
	 
	WHILE sTempChd is not null DO 
			SET sTemp = concat(sTemp,',',sTempChd); 
			SELECT group_concat(pid) INTO sTempChd FROM device_info where id = sTempChd; 
	END WHILE; 
	RETURN sTemp; 
END
;;
DELIMITER ;
